import React, { Component } from 'react';
import './App.css';
import MonsterCard from './components/MonsterCard'; // Import the MonsterCard component

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        { name: 'Linda', id: '1' },
        { name: 'Frank', id: '2' },
        { name: 'Jacky', id: '3' },
        { name: 'Tom', id: '4' },
        { name: 'Jerry', id: '5' },
        { name: 'Mickey', id: '6' },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Monster Rolodex</h1>
        </header>
        <div className="monster-container">
          {this.state.monsters.map((monster) => (
            <MonsterCard key={monster.id} monster={monster} />
          ))}
        </div>
      </div>
    );
  }
}

export default App;
